import ExpenseItem from "./components/ExpenseItem";
import MakeupExpenseItem from "./components/MakeupExpenseItem";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];

  const MakeupExpenses = [
    {
      id: "e5",
      title: "Foundation",
      amount: 54.12,
      date: new Date(2022, 7, 14),
    },
    {
      id: "e6",
      title: "Concealer",
      amount: 49.49,
      date: new Date(2022, 2, 12),
    },
    {
      id: "e7",
      title: "Contour",
      amount: 54.67,
      date: new Date(2022, 2, 28),
    },
    {
      id: "e8",
      title: "Blush",
      amount: 40,
      date: new Date(2022, 5, 12),
    },
  ];

  return (
    <div>
      <h2>Yo! Let's get started!!</h2>
      <ExpenseItem
        title={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[1].title}
        amount={expenses[1].amount}
        date={expenses[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[2].title}
        amount={expenses[2].amount}
        date={expenses[2].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[3].title}
        amount={expenses[3].amount}
        date={expenses[3].date}
      ></ExpenseItem>
      <h2>New Expense</h2>
      <MakeupExpenseItem
        title={MakeupExpenses[4].title}
        amount={MakeupExpenses[4].amount}
        date={MakeupExpenses[4].date}
      ></MakeupExpenseItem>
      <MakeupExpenseItem
        title={MakeupExpenses[5].title}
        amount={MakeupExpenses[5].amount}
        date={MakeupExpenses[5].date}
      ></MakeupExpenseItem>
      <MakeupExpenseItem
        title={MakeupExpenses[6].title}
        amount={MakeupExpenses[6].amount}
        date={MakeupExpenses[6].date}
      ></MakeupExpenseItem>
      <MakeupExpenseItem
        title={MakeupExpenses[7].title}
        amount={MakeupExpenses[7].amount}
        date={MakeupExpenses[7].date}
      ></MakeupExpenseItem>
      <MakeupExpenseItem
        title={MakeupExpenses[8].title}
        amount={MakeupExpenses[8].amount}
        date={MakeupExpenses[8].date}
      ></MakeupExpenseItem>
    </div>
  );
} // end of the function

// 1. export the file
export default App;
